import { Component, OnInit } from '@angular/core';
import { MatSnackBar } from '@angular/material/snack-bar';
import { Router } from '@angular/router';
import { AuthService } from 'src/app/auth/services/auth.service';

@Component({
  selector: 'app-inicio',
  templateUrl: './inicio.component.html',
  styleUrls: ['./inicio.component.css'],
  
})
export class InicioComponent implements OnInit {

  constructor(public router :Router,
              private snackBar: MatSnackBar,
              private authService: AuthService) { }

  barra_llamada : boolean = false;

  
  get usuario() {
    return this.authService.auth;
  }

  ngOnInit(): void {
  }

  llamar_barra(){
       
      if(localStorage.getItem("LOC")){
        this.router.navigate(['./productos/listado']);
      }else{
        this.mostrarSnakbar("Introduce tu municipio / c√≥digo postal")
      }
  }

  ir_perfil_productor(){
    this.router.navigate(['./perfil-productor']);
  }

  ir_soy_komo(){
    this.router.navigate(['./soy-komo']);
  }

  ir_textos_legales(){
    this.router.navigate(['./textos-legales']);
  }


  downloadPdf(base64String: string, fileName: string){
    if(window.navigator && (window.navigator as any).msSaveOrOpenBlob){ 
      // download PDF in IE
      let byteChar = atob(base64String);
      let byteArray = new Array(byteChar.length);
      for(let i = 0; i < byteChar.length; i++){
        byteArray[i] = byteChar.charCodeAt(i);
      }
      let uIntArray = new Uint8Array(byteArray);
      let blob = new Blob([uIntArray], {type : 'application/pdf'});
      (window.navigator as any).msSaveOrOpenBlob(blob, `${fileName}.pdf`);
    } else {
      // Download PDF in Chrome etc.
      const source = `data:application/pdf;base64,${base64String}`;
      const link = document.createElement("a");
      link.href = source;
      link.download = `${fileName}.pdf`
      link.click();
    }

  }

  
  mostrarSnakbar( mensaje: string ) {

    this.snackBar.open( mensaje, 'ok!', {
      duration: 2500
    });

  }

  onClickDownloadPdf(){

    let base64String = ""
    this.downloadPdf(base64String,"sample");
  }

}
